import React,{useState, useEffect} from 'react'
import WeatherCard from './WeatherCard'

export default function WeatherCards(props) {
const [data, setData] = useState(props)

  return (
    <div className='container'> 
      <div className='row'>
        {
        data.length === 0? (<h3>Loading . . .</h3> ) :
            Object.keys(data).map((el) => (
            <WeatherCards key={el.id} name={el.name} temp_c={el.temp_c} temp_f={el.temp_f}
                        icon={el.weatherIcon} localtime={el.localtime}/>
           ))
        }
        <div className='col-md-2'>          
          <WeatherCard/>
        </div>
        <div className='col-md-2'>          
          <WeatherCard/>
        </div>
        <div className='col-md-2'>          
          <WeatherCard/>
        </div>
        <div className='col-md-2'>          
          <WeatherCard/>
        </div>
      </div>
    </div>
  )
}
